import React from "react";

import {TasksFilter} from "./TasksFilter";



const Footer = ({activeItem,onClearCompleted,
                    onActiveVision,onAllVision,
                    onCompletedVision}) => {

    return (
        <footer className="footer">
            <span className="todo-count">{activeItem} items left</span>
            {/*<ul className="filters">*/}
            {/*    <TasksFilter*/}
            {/*        className = 'selected'*/}
            {/*        label = "All"*/}
            {/*        onAllVision={onAllVision}/>*/}
            {/*    <TasksFilter*/}
            {/*        label = "Active"*/}
            {/*        onActiveVision={onActiveVision}*/}
            {/*    />*/}
            {/*    <TasksFilter*/}
            {/*        label = "Completed"*/}
            {/*        onCompletedVision={onCompletedVision}/>*/}
            {/*</ul>*/}
        <TasksFilter
                className = "clear-completed"
                label = "Clear Completed"
                onClearCompleted={onClearCompleted}/>
         </footer>
    );
};

export default Footer;
